INSERT INTO `video` (`member_id`, `video_title`, `video_description`, `img_url`, `catalog_id`, `type`, `scheduled`, `weight`, `publish_status`, `create_time`, `update_time`, `duration`) VALUES ('306', '法国这段以家暴为主题的<em class="keyword">舞蹈</em>，看得人鸡皮疙瘩都起来了', '10月底，法国综艺节目中，两名舞蹈演员呈现了一段“家暴舞蹈”，用优美且冲击力十足的舞蹈动作，还原了触目惊心的家暴。“任何男人都不是残暴的，你向男人展示了没有什么比温柔更强有力。”', '//i1.hdslb.com/bfs/archive/3346ea5f1beb30bd6de49e14a7c16beb2233cdd1.jpg', '106', '0', '0', '100105685', '0', '2023-03-03 13:37:57', '2018-11-20 11:40:04', '258');
