INSERT INTO `video` (`member_id`, `video_title`, `video_description`, `img_url`, `catalog_id`, `type`, `scheduled`, `weight`, `publish_status`, `create_time`, `update_time`, `duration`) VALUES ('308', '可是...王心凌亲自教新华网粉丝跳《爱你》诶！', '王心凌新华网专属限定版《爱你》教学视频出炉咯，跟着王心凌跳《爱你》，一起来健身舞蹈，乘风破浪，关爱自己！', '//i2.hdslb.com/bfs/archive/e46c9ac240586fb0c0233e7b171a5a331afd0409.jpg', '103', '0', '0', '100074676', '0', '2023-03-03 13:09:21', '2022-05-26 10:36:54', '74');
INSERT INTO `video` (`member_id`, `video_title`, `video_description`, `img_url`, `catalog_id`, `type`, `scheduled`, `weight`, `publish_status`, `create_time`, `update_time`, `duration`) VALUES ('309', '《仕风 定风波》，君子如玉，仕风儒雅，国风<em class="keyword">舞蹈</em>展现中国文化之美', '由眉山市歌舞剧院带来的男子群舞，君子如玉，仕风儒雅。国风舞蹈展现中国文化之美，同时展现苏东坡的词《定风波》“莫听穿林打叶声，何妨吟啸且徐行。竹杖芒鞋轻胜马，谁怕一蓑烟雨任平生。料峭春风吹酒醒，微冷，山头斜照却相迎。回首向来萧瑟处，归去，也无风雨也无晴。”#2022成都春晚', '//i1.hdslb.com/bfs/archive/df43a381e5abc91e2563bcbea8da08d7039839a2.jpg', '105', '0', '0', '100060363', '0', '2023-03-03 13:47:20', '2022-02-02 21:15:31', '339');
INSERT INTO `video` (`member_id`, `video_title`, `video_description`, `img_url`, `catalog_id`, `type`, `scheduled`, `weight`, `publish_status`, `create_time`, `update_time`, `duration`) VALUES ('310', '学武术哥哥和学<em class="keyword">舞蹈</em>妹妹边练劈叉边玩手机 妈妈：能玩多久各凭本事', '11月30日，山东济南，一条关于学武术哥哥和学舞蹈妹妹边玩手机边练劈叉的视频引网友点赞。据了解，11岁的哥哥学武术，6岁的双胞胎妹妹们学舞蹈，劈叉对孩子们来说不难。孩子们每个周末写完所有作业就想玩会儿手机，为了避免孩子们过久使用电子产品损害视力，妈妈便想出了这个办法。劈叉超过半小时腿会有麻木感，孩子们就不得不放下手机起来活动一会儿。网友：厉害了', '//i1.hdslb.com/bfs/archive/2dfca5e266328403468772b5531efb0246b1f774.jpg', '105', '0', '0', '100058393', '0', '2020-12-02 18:02:56', '2020-12-02 18:02:56', '33');
