INSERT INTO `video` (`member_id`, `video_title`, `video_description`, `img_url`, `catalog_id`, `type`, `scheduled`, `weight`, `publish_status`, `create_time`, `update_time`, `duration`) VALUES ('316', '女生<em class="keyword">舞蹈</em>课上展优美舞姿,突然一个声响害羞遮住屁股,全班哄堂大笑', '12月27日，广西。舞蹈课上，一名女生展现优美的舞姿，高难度动作，一系列动作完成后，突然发出了一个声响，女生笑一笑遮住了屁股，其他同学忍不住哄堂大笑。网友称，完成一套动作，吹响了胜利的号角。', '//i0.hdslb.com/bfs/archive/3cc5ca1be02f23bbbc8e3965e4b23b61e54f5280.jpg', '105', '0', '0', '100048545', '0', '2023-03-03 11:23:31', '2021-12-27 19:23:34', '61');
