INSERT INTO `video` (`member_id`, `video_title`, `video_description`, `img_url`, `catalog_id`, `type`, `scheduled`, `weight`, `publish_status`, `create_time`, `update_time`, `duration`) VALUES ('316', '四川农大回应军训<em class="keyword">舞蹈</em>表演争议:加强管理引导,组织健康高雅活动', '近日，四川。四川农业大学军训休息期间一舞蹈表演引发热议。学校19日通报称：学生表演是在9月17日军训休息期间，因主席台背景板未及时撤除，被网友误解为发生在9月10日的开学典礼上。学校已安排调查核实情况，要求主管部门加强学生活动的管理和引导，组织开展健康高雅的文化活动。', '//i2.hdslb.com/bfs/archive/9d6f6bdd9737b5ebe73d5fcf7792a8ec79a5b3f0.jpg', '105', '0', '0', '100045388', '0', '2023-03-03 11:23:13', '2021-09-19 18:06:15', '54');
INSERT INTO `video` (`member_id`, `video_title`, `video_description`, `img_url`, `catalog_id`, `type`, `scheduled`, `weight`, `publish_status`, `create_time`, `update_time`, `duration`) VALUES ('315', '<em class="keyword">舞蹈</em>生轮流称重，反应复制粘贴，崩溃就在一瞬间', '3月9日，广东广州，一名舞蹈生在宿舍准备称体重，在她踏上称看到数字时瞬间崩溃，另一名女生淡定上称，结果看到数字的反应和第一位女生一模一样，其中一位女生表示因为都是舞蹈生，老师管理体重比较严格，网友评论：舞蹈生永远的痛，还有网友评论：有没有可能是称坏了', '//i1.hdslb.com/bfs/archive/37431430c71d0f8b82b6092026d544ff44587a36.jpg', '105', '0', '0', '100045332', '0', '2022-03-11 16:43:15', '2022-03-11 16:43:15', '62');
INSERT INTO `video` (`member_id`, `video_title`, `video_description`, `img_url`, `catalog_id`, `type`, `scheduled`, `weight`, `publish_status`, `create_time`, `update_time`, `duration`) VALUES ('320', '泪目！患阿兹海默症的芭蕾舞者听到天鹅湖 坐在轮椅上跳起了熟悉的<em class="keyword">舞蹈</em>', '患阿兹海默症老奶奶Marta C. González在上世纪60年代曾经是纽约芭蕾舞团的舞者。晚年的她生活在西班牙瓦伦西亚的一家疗养院，当她听到耳机里传来的《天鹅湖》，她坐在轮椅上跟着舞动起来，动作、节奏，她都还记得...', '//i1.hdslb.com/bfs/archive/755be4888e2754392c5141af5a5aedf67b90a66b.jpg', '103', '0', '0', '100043071', '0', '2023-03-03 12:39:08', '2020-11-11 10:33:30', '111');
