INSERT INTO `video` (`member_id`, `video_title`, `video_description`, `img_url`, `catalog_id`, `type`, `scheduled`, `weight`, `publish_status`, `create_time`, `update_time`, `duration`) VALUES ('327', '广州一女子练绸缎舞掉落或致下半身瘫痪，<em class="keyword">舞蹈</em>室将垫付10万医药费', '近日，有市民向南都、N视频记者报料，称其妻子在广州增城一空中舞蹈工作室培训时，因器材损坏从空中跌落，致颈椎脱位伴脊髓损伤 ，下肢失去知觉。经协商后，对方同意签署10万元垫付医药费的承诺书，但截至目前为止，剩余垫付医疗费6万元仍未到账。9月16日，记者跟随方先生家属来到工作室协商，工作室负责人承诺每周垫付2万元，三周内补完10万元。', '//i1.hdslb.com/bfs/archive/ba35a58a31fde320384f1e5950e9b488c4549242.jpg', '105', '0', '0', '100037584', '0', '2023-03-03 12:20:47', '2021-09-25 10:37:09', '179');
INSERT INTO `video` (`member_id`, `video_title`, `video_description`, `img_url`, `catalog_id`, `type`, `scheduled`, `weight`, `publish_status`, `create_time`, `update_time`, `duration`) VALUES ('312', '当<em class="keyword">舞蹈</em>生称体重之后……这崩溃是复制粘贴吗？', '3月9日，广东广州，静静同学和室友都是舞蹈生，老师对她们体重的要求都很严格，过了个年之后，大家都胖了不少，第二天老师就要给她们称体重了，她们有点不知所措，就提前在宿舍称自己的体重，结果，上了秤之后，看到体重瞬间就崩溃了。', '//i0.hdslb.com/bfs/archive/97ed208ae8ba50c45df4a1b10fac406431367c93.jpg', '105', '0', '0', '100037496', '0', '2023-03-03 14:03:41', '2022-03-12 17:29:08', '46');
INSERT INTO `video` (`member_id`, `video_title`, `video_description`, `img_url`, `catalog_id`, `type`, `scheduled`, `weight`, `publish_status`, `create_time`, `update_time`, `duration`) VALUES ('311', '民间传统<em class="keyword">舞蹈</em>锦鸡舞《嘎迪朶》', '锦鸡舞是苗族芦笙舞中别具一格的民间传统舞蹈，发源于贵州省黔东南，主要流传于苗族“旮弄”支系中穿锦鸡服饰的锦鸡苗族。锦鸡舞模仿大自然中锦鸡觅食、嬉戏、展翅翱翔等动作，轻盈流畅、优雅自然，很受人们喜爱。', '//i1.hdslb.com/bfs/archive/28629cc2ab2ff966f4fb021d384a178da835dd68.jpg', '103', '0', '0', '100037323', '0', '2023-03-03 11:41:56', '2021-07-19 22:15:13', '280');
