INSERT INTO `video` (`member_id`, `video_title`, `video_description`, `img_url`, `catalog_id`, `type`, `scheduled`, `weight`, `publish_status`, `create_time`, `update_time`, `duration`) VALUES ('329', '纪念普京首次当选总统20周年，克宫公布普京与小布什表演俄罗斯传统<em class="keyword">舞蹈</em>', '纪念普京首次当选总统20周年,克里姆林宫新闻处近日公布了一份2005年至2009年间的录像档案，视频中，俄罗斯总统普京与时任美国总统小布什一起跳了一段俄罗斯传统舞蹈。', '//i2.hdslb.com/bfs/archive/bc0e4d500e6f813448f40beba6d3243615323b1b.jpg', '106', '0', '0', '100036198', '0', '2023-03-03 13:52:37', '2020-01-14 09:45:23', '47');
