INSERT INTO `video` (`member_id`, `video_title`, `video_description`, `img_url`, `catalog_id`, `type`, `scheduled`, `weight`, `publish_status`, `create_time`, `update_time`, `duration`) VALUES ('311', '女子自编<em class="keyword">舞蹈</em> 讽刺那些以自我为中心的白人女性', '美国女子自编搞怪舞蹈，讽刺一些自以为是的白人女性。“凯伦”是指以自我为中心，并通常有种族主义倾向的白人女性。', '//i1.hdslb.com/bfs/archive/cbe06c1267c3919eedb51b7dcc2f0da5e62bf205.jpg', '104', '0', '0', '100034559', '0', '2023-03-03 11:51:54', '2020-07-08 17:41:11', '34');
INSERT INTO `video` (`member_id`, `video_title`, `video_description`, `img_url`, `catalog_id`, `type`, `scheduled`, `weight`, `publish_status`, `create_time`, `update_time`, `duration`) VALUES ('320', '一场特殊的生日会！帕米尔高原上兵哥哥们边烤肉边跳起了快乐的<em class="keyword">舞蹈</em>', '据央视军事报道，近日，海拔3500米的帕米尔高原，武警新疆总队官兵在驻训间隙举行了一场特别的沙场集体生日会！绵延的雪山下，兵哥哥们摆上蛋糕，烤上肉串，唱响生日歌，跳起民族舞……转起！生日快乐！', '//i0.hdslb.com/bfs/archive/19f3b378dfc0f19902cd9b9a7bf1005ac4894d34.jpg', '103', '0', '0', '100034406', '0', '2023-03-03 12:42:49', '2020-09-20 08:47:23', '49');
INSERT INTO `video` (`member_id`, `video_title`, `video_description`, `img_url`, `catalog_id`, `type`, `scheduled`, `weight`, `publish_status`, `create_time`, `update_time`, `duration`) VALUES ('316', '男子无意练出<em class="keyword">舞蹈</em>绝技，乐疯了脱衣庆祝，网友：上辈子是个陀螺吧', '男子无意练出舞蹈绝技，乐疯了脱衣庆祝，网友：上辈子是个陀螺吧', '//i1.hdslb.com/bfs/archive/bd56fa9e93f2311f53254897f910f12a6eb21632.jpg', '105', '0', '0', '100033971', '0', '2023-03-03 11:13:09', '2021-07-19 17:47:02', '16');
INSERT INTO `video` (`member_id`, `video_title`, `video_description`, `img_url`, `catalog_id`, `type`, `scheduled`, `weight`, `publish_status`, `create_time`, `update_time`, `duration`) VALUES ('321', '美到窒息！河南广电“七夕奇妙游”<em class="keyword">舞蹈</em>《龙门金刚》', '舞蹈在展示龙门乐伎和飞天的同时，着重塑造龙门金刚大力士的艺术形象。舞蹈抓取龙门石窟雕刻的生动多样的金刚形象，并运用AR技术加入科技感包装，在节目中，还根据石窟研究成果将奉先寺进行电脑着色复原。在将绚丽多彩的龙门石窟文化展现给世人的同时，融入多媒体时代的审美和展现手段。', '//i2.hdslb.com/bfs/archive/26b49f4ddb60030c67f6a05530efe69867884b2b.jpg', '103', '0', '0', '100033043', '0', '2023-03-03 13:23:44', '2021-08-13 21:28:05', '213');
